Cisco wireless was breaking the build due to flaky tests. There were few cases I tested with Raju:

The problems that we could Identified were:

1- Merge and Replace inside the same mutate statement:

mutate {
   replace => {...}
   merge => {...}
}

Solution: separate merge to its own statement

mutate {
   merge => {...}
}

mutate {
   replace => {...}
}

2- Merge of the same object in the same merge statement:

mutate {
  merge => {
    target.ip => "ip"
    target.mac => "mac"
  }
}

Solution: separate the merge statement:

mutate {
   merge => {target.ip => "ip"}
}

mutate {
   merge => {target.mac => "mac"}
}

3- Sometimes the code was breaking out of nowhere: 

Seems the version of our dev cli_main is different from the build.

Obs: The safest way to make sure everything goes well:

. Do not ever use merge statement for more than one field
. Do not ever use merge and replace in the same mutate statement
